export default function Card(props) {
    return (
        <a href={props.input.url}>
            <div className="card">
                <img src={"/images/"+props.input.imageUrl} className="cardImage"/>
                <h1>{props.input.title}</h1>
                <h4>{props.input.blurb}</h4>
                <p>{props.input.date}</p>
            </div>
        </a>
    )
}
